.content-page {
	width: 100%;
	height: 100%;
	/* background: #ff9f80; */
}
.calender-btn {
	width: 100%;
	height: 40px;
	margin-top: -40px;
	background: transparent;
	display: flex;
	justify-content: center;
	align-items: center;
	span {
		width: 20px;
		height: 20px;
		margin: 0 20px;
		img {
			width: 100%;
			height: 100%;
		}
	}
}
.calendar {
	width: 100%;
	color: #fff;
	position: relative;
	/* margin-top: -40px; */
	z-index: 1100;
	/* background: #ff9f80; */
}
.calendar h4 {
	text-align: center;
	font-size: 15px;
	font-weight: 700;
	margin-bottom: 0px;
	height: 50px;
	line-height: 50px;
}
.calendar span {
}
.calendar .sign_tab {
	width: 100%;
	height: 100%;
	border-collapse: collapse;
	border-top: 0;
	table-layout: fixed;
	background: #ff9f80;
}
.calendar .sign_tab thead {
	border-top: 10px #ff9f80 solid;
}
.calendar .sign_tab tr {
	background: #ff9f80;
}
.calendar .sign_tab th {
	text-align: center;
	height: 15px;
	font-size: 15px;
}
.calendar .sign_tab td {
	width: 15px;
	height: 15px;
	text-align: center;
	font-size: 15px;
	padding: 7px 0;
}
.calendar .sign_tab td.over {
	border-left: 0;
	border-right: 0;
}
.calendar .ui-state-default {
	/* background: url(../assets/image/icon_chosen@3x.png) no-repeat;
	background-size: 12px; */
}
.calendar .sign_tab td span {
	display: inline-block;
	width: 24px;
	height: 24px;
	font-size: 15px;
	position: relative;
}
.calendar .sign_tab td span .clock {
	width: 12px;
	height: 12px;
	position: absolute;
	bottom: 0;
	right: 0;
}
.calendar .sign_tab td span.cur_day {
	width: 24px;
	height: 24px;
	background: rgba(255, 255, 255, 0.3);
	border-radius: 50%;
}
.showTime {
	display: block;
	width: 100%;
	text-align: center;
	padding: 5px;
	display: flex;
	justify-content: center;
	align-items: center;
	background: #ff9f80;
	margin: 0 auto;
	img {
		width: 20px;
		height: 20px;
		margin: 0 auto;
	}
}
